 }
 
function Heading(){
    return(
        <>
        <h1 className={trial}> It's a Function.</h1>
        <h1 style={trial}>Hello World!!!</h1>
        <img src="https://picsum.photos/200"  alt="Random Image"></img>
        </>
    )
}

